import React, { useEffect } from "react";

export const NearbySearch_TabResults = (props) => {


    const LineExtense = () => {
        const LineExtense = document.getElementById('LocationSearch_filter_Container')
        LineExtense.style.height = 'fit-content'
    }

    const Place_Photo_Inspector = (input) => {
        switch(typeof input.photos){
            case('object'):
            return input.photos[0].getUrl()

            case('undefined'):
            return 'none'
        }
    }

    useEffect(()=>{
       LineExtense()
    },[])

    return <React.Fragment>

    <div
    style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: ' 0 0 4vh 5vw',
        margin: '4vh 0'
    }}>


    {props.places.map((place)=>{
        return <div
        style={{
            width: '45vw',
            height: '25vh',
            border: 'black solid 5px',
            borderRadius: '20px',
            margin: '2vh 0',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center'
        }}>
            <img 
            src={Place_Photo_Inspector(place)}
            style={{
                width: '44vw',
                height: '15vh',
                borderRadius: '15px',
                border: 'white solid 2px',
                objectFit: 'cover'
            }}
            ></img>
            
            <div
                style={{
                    display:'flex',
                    flexDirection:'column'
                }}
            >

                <span>
                    {place.name}
                </span>
                <span>
                    {place.rating}
                </span>

            </div>

        </div>
    })}

    </div>

    </React.Fragment>

}

export default NearbySearch_TabResults;
